  the Caribbean region. Oil and gas field symbols represent field center-points and
  are published with permission from Petroconsultants International Data Corporation,
  2002 database.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
